import React from 'react';

const AutoUploadImage = ({ image, uploading }) => {

    return (
        <div style={{ position: 'relative' }}>
            <img src={image} alt="activityImg" className="img-thumbnail" />
        </div>
    );
};

export default AutoUploadImage;
